import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const Home = () => {
  return (
    <View style={styles.container}>
        <View style={styles.top}>
            <Text>Before we proceed, I would like to confirm that you understand and agree to the terms of [describe the purpose or activity for which consent is being obtained, e.g., recording your voice, using your voice in a podcast, etc.]. Your participation is completely voluntary, and you have the right to decline or withdraw your consent at any time without any negative consequences.</Text>
            <Text> Important Discloser & User Consent</Text>
        </View>
      <Text style>Home</Text>
    </View>
  )
}

export default Home

const styles = StyleSheet.create({
    container:{
        margin:5,
    },
    top:{
        margin:10,
        padding:5,
        backgroundColor:'blue',
    }
})
